package PrototypePattern;import org.junit.Test;public class TestRun {    @Test    public void run() throws CloneNotSupportedException {        PrototypePattern obj1 = new PrototypePattern();        PrototypePattern obj2 = (PrototypePattern)obj1.clone();        System.out.println(obj2 == obj1);    }    @Test    public void run2() throws CloneNotSupportedException {        PrototypePattern obj1 = new PrototypePattern();        PrototypePattern obj2 = (PrototypePattern)obj1.clone();        obj2.setType(2);        System.out.println(obj1.getType());        System.out.println(obj2.getType());        System.out.println(obj1.getParam() == obj2.getParam());    }}